import React from "react";
import Activities from "./Activities";

const ActivitiesList = () => {
  return (
    <div className="activities">
      <div className="activities__header">
        <h2>Recent Activities</h2>
      </div>
      <Activities />
    </div>
  );
};

export default ActivitiesList;
